import styled from "styled-components"

const BigBall = styled.div`
    width: 50px;
    height: 50px;
    position: relative;
    background: rgba(196, 196, 196, 0.5);
    border-radius: 50%;
    `
const SmallBall = styled.div`
    width: 33px;
    height: 33px;
    position: absolute;
    top: 0;
    left: 50%;
    transform: translateX(-50%);
    background: rgba(230, 63, 63, 0.85);
    border-radius: 50%;
    `

export default function Logo() {
    return (
        <BigBall>
            <SmallBall />
        </BigBall>
    )
}
